          "description": "gli Arcade Boyz reagiscono al nuovo disco di Geolier dal titolo \" IL CORAGGIO DEI BAMBINI \"\nLe traduzioni dei testi fatte dai nostri utenti le puoi trovare ⬇ SOTTO IL COMMENTO FISSATO IN ALTO ⬇   #arcadeboyz #geolier #reaction \n\nA 3 anni dall’esordio discografico tra i più eclatanti e di grande successo dell’attuale panorama urban italiano  GEOLIER TORNA CON IL SUO NUOVO ALBUM  E INAUGURA IL 2023 METTENDO FINE  ALLA GRANDISSIMA ATTESA DEI FAN \nA proposito del “Coraggio dei Bambini” Geolier racconta: “Il titolo dell’album è arrivato alla fine di tutto, quando ho visto che in molte delle tracce parlavo dei bambini, della loro forza, del coraggio che hanno. I bambini sono senza filtri e anche quando hanno paura di qualcosa non si fermano, ci provano sempre lo stesso a ottenerla. E anche per me e le persone che mi stanno attorno spesso è stato così. La vita ci ha messo davanti tante cose belle, ma anche tante cose difficili. Noi abbiamo deciso di avere coraggio e affrontarle proprio come fanno i bambini”.\nE continua: “Con questo album ho voluto raccontare ogni pensiero, disagio, sentimento che prova un napoletano, così come lo farebbe un napoletano. È importante per me rappresentare la mia gente.”\n\nGeolier il coraggio dei bambini TRACK LIST :\n\nRICCHEZZA (prod. Dat Boi Dee)\nPOCO/TROPPO (prod. Dat Boi Dee)\nX CASO feat. Sfera Ebbasta (prod. Dati Boi Dee, Daves The Kid)\nME VULEV FA RUOSS\nLONELY (prod. Poison Beatz)\nNUN SE VER feat. Guè (prod. Dat Boi Dee)\nMONDAY feat. Shiva (prod. Michelangelo)\nMONEY (prod. Dat Boi Dee, Poison Beatz)\nMARADONA (prod. Dat Boi Dee)\nI AM (prod. Dat Boi Dee)\nNAPO****NO (prod. Dat Boi Dee)\nNIENTE DI SPECIALE (prod. Dat Boi Dee)\nCOME VUOI (prod. Dat Boi Dee)\nIN TRAPPOLA feat. Lele Blade (prod. Dat Boi Dee, Poison Beatz)\nHERE I COME (prod. Poison Beatz)\nCHIAGNE feat. Lazza, Takagi & Ketra (prod. Takagi & Ketra)\nNON CI TORNI PIÙ feat. Paky (prod. Dat Boi Dee)\nGIVE YOU MY LOVE (prod. Dat Boi Dee)"
